// Enable/disable dropdown based on parent radio select
$(document).ready(function(){
    $('input[name="filingstatus"]').click(function() {
       if($('input[name="filingstatus"]').is(':checked')) { 
           var radioValue = $("input[name='filingstatus']:checked").val();
            if(radioValue == "f"){
               $( "#haveFiled" ).prop( "disabled", false );
               $( "#haveNotFiled" ).prop( "disabled", true );
               $( "#addr_nonfiler" ).hide();
               $( "#addr_filer" ).show();
            } else {
              $( "#haveFiled" ).prop( "disabled", true );
               $( "#haveNotFiled" ).prop( "disabled", false );
               $( "#addr_nonfiler" ).show();
               $( "#addr_filer" ).hide();
            }
       }
    });
});
