// Edit input
$(document).ready(function() {
	$('.standard input[name="Edit"]').click(function() {
	    $(this).val(function(i,v) {
	        return v === 'Edit' ? 'Save' : 'Edit';
	    })
	    $(this).parent().prev('input[required]').prop('readonly',function(i,r) {
	        return !r;
	    });
	});
});

// Edit input (for input with has-feedback)
$(document).ready(function() {
	$('.has-feedback input[name="Edit"]').click(function() {
	    $(this).val(function(i,v) {
	        return v === 'Edit' ? 'Save' : 'Edit';
	    });
        //$(this).parent().prev().prev().next('img').toggle();
        $(this).parent().prev().prev().next('img').toggleClass('icon-inactive');
	    $(this).parent().prev().prev('input[required]').prop('readonly',function(i,r) {
	        return !r;
	    });
	});
});
//Place this plugin snippet into another file in your applicationb
(function ($) {
    $.toggleShowPassword = function (options) {
        var settings = $.extend({
            field: "#password",
            control: "#toggle_show_password",
        }, options);

        var control = $(settings.control);
        var field = $(settings.field)

        control.bind('click', function () {
            if (control.is(':checked')) {
                field.attr('type', 'password');
            } else {
                field.attr('type', 'text');
            }
        })
    };
}(jQuery));

//Here how to call above plugin from everywhere in your application document body
$.toggleShowPassword({
    field: '#username-input',
    control: '#username-input2'
});
